import "./App.css";
import Header from "./Header";
import Homepage from "./Homepage";
import GCPResources from "./GCPResources";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/gcp_resources">
            <GCPResources></GCPResources>
          </Route>

          <Route path="/home">
            <Header></Header>
            <Homepage></Homepage>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
